import { palette } from "@toptal/picasso/utils";

export const navContainer = {
  backgroundColor: palette.blue.dark,
  color: "white",
};

export const navTypo = {
  borderLeft: "1px solid white",
  padding: "0.25rem",
  paddingLeft: "0.75rem",
};

export const navSubContainer = {
  with: "50%",
};
